import Container from "../components/container";
import Link from "next/link";

export interface MauroProps {}

const Mauro: React.SFC<MauroProps> = () => {
  return (
    <Container>
      ¿Buscas soluciones informáticas? Que esperas para contactarme?: - LiN:{" "}
      <Link href="https://www.linkedin.com/in/mauro-freire-018588a/">
        <a>Click here</a>
      </Link>
    </Container>
  );
};

export default Mauro;
